    return(
        <div className='container d-flex justify-content-between'>
            <Guess img={unknown} name={Name1} desc={'An American grandmaster, He became the World Chess Champion in 1972 after defeating Boris Spassky, and is renowned for his brilliant tactical play.'}/>
